SimpleFactory.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity 0.8.19;

import {Simple} from "Simple.sol";

contract Factory {

mapping (uint256 => address) public MyMap;

function CreateContract (uint256 _Counter) public {
Simple SimpleContract = new Simple ();
MyMap [_Counter] = (address(SimpleContract));
}
}

Simple.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity 0.8.19;

contract Simple {

struct EventsData {
uint256 Timestamp;
string Event;
}

EventsData [] MyEventsData;

mapping (uint256 => string) MyMap;

function CreateEvent (uint256 _Timestamp, string memory _Event) public {
MyMap [_Timestamp] = _Event;
MyEventsData.push (EventsData(_Timestamp, _Event));
}
}

